import React from "react";

const CountryNames = ({ NamesToShow }) => (
  <div>
    {NamesToShow.map((country) => (
      <h4 key={country.name + Math.random() * 123}>{country.name}</h4>
    ))}
  </div>
);

export default CountryNames;
